text:
Formalizagao da relacdo de parceria, em regime de mititua
cooperagado entre o MUNICIPIO e a O.S.C., para a consecucaéo de
finalidades de interesse ptiblico e reciproco, mediante a execucdo de gestao compartilhada, incluindo controle de insumos, gestao de pessoal, realizacao de exames laboratoriais de pacientes internados e prontudario eletrénico, do Hospital Municipal de Campanha para combate ao COVID-19 (HOSPITAL NOSSA SENHORA DE FATIMA), na cidade de Parnaiba (PD, tendo base o Chamamento Ptblico n° 01/2020, que trata do credenciamento de organizacdes da sociedade civil para fomento de projetos voltados a modernizacao administrativa e oferta de servicos de relevancia publica em satide, conforme Termo de Homologacaéo Publicado no DOM n° 2591, de 17 de abril de 2020, conforme termo de referéncia parte integrante do presente Termo de Colaboracao. Os cargos e quantitativos serao autorizados pelo conselho de gestao da prefeitura de Parnaiba, tudo definido no Plano de Trabalho, em decorréncia do Chamamento Público 01/2020, de interesse da Secretaria de Satide do Municipio de Parnaiba, de relevancia ptiblica e social definido no Plano de Trabalho, que rubricado pelas partes, integra o presente instrumento;
